rong>-&nbsp;</strong><a href=\"http://www.zakzak.ch/hotel.htm\" rel=\"noopener noreferrer\" target=\"_blank\"><strong>Detaillierte Angaben</strong></a></p><p><br></p>','Zentralstrasse 41, 8212 Neuhausen am Rheinfall, Schweiz','Coole Drinks - Billiard - Dart - Snacks - Internet','+41 (0)52 672 55 21','http://www.zakzak.ch/','4c973896-5761-41fc-8217-07c5d13a004b',_binary '',50,100,'HOURLY');
